import React from 'react';
import "../Component-CSS/Navbar.css"
function Navbar() {
    return (
        <div className='Navbar'>

            <div>
                <button>
                    <FontAwesomeIcon icon="fa-solid fa-bars" />
                </button>
            </div>

            <div>
                <link>Home</link>
            </div>
        </div>
    )
}
export default Navbar;
